import React from "react";

const Header = () => {
  const menuList = [];

  return (
    <div>
      <div className="d-flex justify-content-between align-items-center">
        <div>
          <img src="/assets/images/logo.png" alt="logo" />
        </div>
        <div></div>
      </div>
    </div>
  );
};

export default Header;
